var title_f41_63_42999="M ozzardi life cycle";
var content_f41_63_42999=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F83929&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F83929&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 588px\">",
"   <div class=\"ttl\">",
"    Mansonella ozzardi life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 568px; height: 420px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During a blood meal, an infected anthropod (midges, genus",
"    <em>",
"     Culicoides",
"    </em>",
"    , or blackflies, genus",
"    <em>",
"     Simulium",
"    </em>",
"    ) introduces third-stage filarial larvae onto the skin of the human host, where they penetrate into the bite wound",
"    <strong>",
"     (1)",
"    </strong>",
"    . They develop into adults that commonly reside in subcutaneous tissues",
"    <strong>",
"     (2)",
"    </strong>",
"    . Adult worms are rarely found in humans. The size range for female worms is 65 to 81 mm in length and 0.21 and 0.25 mm in diameter but unknown for males. Adult worms recovered from experimentally-infected Patas monkeys measured 24 to 28 mm in length and 70 to 80 micrometers in diameter (males) and 32 to 62 mm in length and 0.13 to 0.16 mm in diameter (females). Adults produce unsheathed and non-periodic microfilariae that reach the blood stream",
"    <strong>",
"     (3)",
"    </strong>",
"    . The arthropod ingests microfilariae during a blood meal",
"    <strong>",
"     (4)",
"    </strong>",
"    . After ingestion, the microfilariae migrate from the arthropod's midgut through the hemocoel to the thoracic muscles",
"    <strong>",
"     (5)",
"    </strong>",
"    . There the microfilariae develop into first-stage larvae",
"    <strong>",
"     (6)",
"    </strong>",
"    . The third-stage infective larvae migrate to arthropod's proboscis",
"    <strong>",
"     (8)",
"    </strong>",
"    and can infect another human when the arthropod takes a blood meal",
"    <strong>",
"     (1)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Filariasis. Available at:",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/frames/a-f/filariasis/body_Filariasis_m_ozzardi.htm\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/frames/a-f/filariasis/body_Filariasis_m_ozzardi.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
