var title_f41_63_43002="ECG atrial flutter preexcitation";
var content_f41_63_43002=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F78602&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F78602&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1275px;\">",
"  <div class=\"figure\" style=\"width: 561px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) showing atrial flutter in preexcitation syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 541px; height: 304px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Atrial flutter is generated within the right atrium and the atrial impulses in this case are conducted to the ventricle by an accessory pathway. There is 1:1 conduction with a ventricular rate of 300 beats/min. The QRS complexes are widened or aberrant and have a bundle branch block morphology and a left axis deviation, suggesting the presence of a atriofascicular (Mahaim) accessory pathway.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
